// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract AccessControl {
    address public admin; // The address of the administrator

    // Mapping to store whether an address has admin privileges
    mapping(address => bool) public isAdmin;

    // Mapping to store candidate addresses by their IDs
    mapping(address => bool) public candidateAddresses;

    // Mapping to store whether an address is a registered voter
    mapping(address => bool) public voters;

    // Mapping to store the vote count for each candidate
    mapping(address => uint) public voteCounts;

    // Variable to keep track of the total number of candidates
    uint public candidateCount;

    // Flag to indicate whether the result has been finalized
    bool public resultFinalized;

    // Event to notify when admin privileges are granted or revoked
    event AdminUpdated(address indexed _admin, bool _isAdmin);

    // Event to notify when a new candidate is added
    event CandidateAdded(address _candidate, bool _added);

    // Event to notify when a voter is registered
    event VoterRegistered(address indexed _voter);

    // Event to notify when a vote is cast
    event VoteCast(address indexed _candidate, address indexed _voter);

    // Event to notify when the result is finalized
    event ResultFinalized();

    // Modifier to restrict access to the admin
    modifier onlyAdmin() {
        require(isAdmin[msg.sender], "Only admin can call this function");
        _;
    }

    // Constructor to set the initial admin
    constructor() {
        admin = msg.sender;
        isAdmin[msg.sender] = true;
        emit AdminUpdated(msg.sender, true);
    }

    // Function to grant admin privileges to an address (only accessible to the current admin)
    function grantAdmin(address _user) public onlyAdmin {
        isAdmin[_user] = true;
        emit AdminUpdated(_user, true);
    }

    // Function to revoke admin privileges from an address (only accessible to the current admin)
    function revokeAdmin(address _user) public onlyAdmin {
        require(_user != admin, "Cannot revoke admin privileges from the main admin");
        isAdmin[_user] = false;
        emit AdminUpdated(_user, false);
    }

    // Function to add a new candidate with address (only accessible to the admin)
    function addCandidate(address _address) public onlyAdmin {
        require(!candidateAddresses[_address], "Address is already registered as a candidate");
        require(!voters[_address], "Address is already registered as a voter");

        candidateAddresses[_address] = true;
        candidateCount++;
        emit CandidateAdded(_address, true);
    }

    // Function to register a voter (only accessible to the admin)
    function registerVoter(address _voter) public onlyAdmin {
        require(!voters[_voter], "Address is already registered as a voter");
        require(!candidateAddresses[_voter], "Address is already registered as a candidate");

        voters[_voter] = true;
        emit VoterRegistered(_voter);
    }

    // Function to cast a vote (accessible to registered voters)
    function castVote(address _candidate) public {
        require(voters[msg.sender], "Only registered voters can cast votes");
        require(candidateAddresses[_candidate], "Invalid candidate address");

        voteCounts[_candidate]++;
        emit VoteCast(_candidate, msg.sender);
    }

    // Function to get the total vote count for a candidate
    function getVoteCountForCandidate(address _candidate) public view returns (uint) {
        require(candidateAddresses[_candidate], "Invalid candidate address");
        return voteCounts[_candidate];
    }

    // Function to finalize the result (only accessible to the admin)
    function finalizeResult() public onlyAdmin {
        // Ensure that the result has not been finalized yet
        require(!resultFinalized, "Result has already been finalized");

        // Step 1: Basic data collection
        uint totalVotes = 0;
        for (uint i = 0; i < candidateCount; i++) {
            address candidate = candidateAtIndex(i);
            totalVotes += voteCounts[candidate];
        }

        // Step 2: Determine the decision rate (8% of total votes)
        uint decisionRate = totalVotes * 8 / 100;

        // Step 3: Determine eligible candidates and exclude those below the threshold
        address[] memory eligibleCandidates = new address[](candidateCount);
        uint eligibleCount = 0;
        for (uint i = 0; i < candidateCount; i++) {
            address candidate = candidateAtIndex(i);
            if (voteCounts[candidate] >= decisionRate) {
                eligibleCandidates[eligibleCount] = candidate;
                eligibleCount++;
            }
        }

        // Step 4: Sort eligible candidates by vote counts (descending order)
        sortCandidates(eligibleCandidates, 0, eligibleCount - 1);

        // Step 5: Allocate seats to candidates based on Sant Logy method

        // Step 6: Handle quotient equality

        // Step 7: Allocate seats to candidates

        // Mark the result as finalized
        resultFinalized = true;
        emit ResultFinalized();
    }

    // Function to get the list of registered voters
    function getRegisteredVoters() public view returns (address[] memory) {
        address[] memory registeredVotersList = new address[](candidateCount);
        uint index = 0;
        for (uint i = 0; i < candidateCount; i++) {
            address candidate = candidateAtIndex(i);
            if (voters[candidate]) {
                registeredVotersList[index] = candidate;
                index++;
            }
        }
        return registeredVotersList;
    }

    // Function to get the list of registered candidates
    function getRegisteredCandidates() public view returns (address[] memory) {
        address[] memory registeredCandidatesList = new address[](candidateCount);
        uint index = 0;
        for (uint i = 0; i < candidateCount; i++) {
            address candidate = candidateAtIndex(i);
            if (candidateAddresses[candidate]) {
                registeredCandidatesList[index] = candidate;
                index++;
            }
        }
        return registeredCandidatesList;
    }
    function candidateAtIndex(uint index) internal view returns (address) {
        require(index < candidateCount, "Index out of bounds");
        address candidate = address(0);
        uint currentIndex = 0;
        for (uint i = 0; i < candidateCount; i++) {
            if (candidateAddresses[admin]) {
                if (currentIndex == index) {
                    candidate = admin;
                    break;
                } else {
                    currentIndex++;
                }
            }
        }
        return candidate;
    }


    // Function to recursively sort candidates based on vote counts (descending order)
    function sortCandidates(address[] memory _candidates, uint _left, uint _right) internal view {
        if (_left < _right) {
            uint _pivotIndex = partition(_candidates, _left, _right);
            sortCandidates(_candidates, _left, _pivotIndex);
            sortCandidates(_candidates, _pivotIndex + 1, _right);
        }
    }

    // Function to partition candidates array for sorting
    function partition(address[] memory _candidates, uint _left, uint _right) internal pure returns (uint) {
        uint _pivotValue = 0;
        uint _i = _left;
        uint _j = _right;
        while (_i < _j) {
            while (_i <= _j && uint(uint160(_candidates[_i])) >= _pivotValue) _i++;
            while (_i <= _j && uint(uint160(_candidates[_j])) < _pivotValue) _j--;
            if (_i < _j) {
                ( _candidates[_i], _candidates[_j]) = (_candidates[_j], _candidates[_i]);
                _i++;
                _j--;
            }
        }
        return _i - 1;
    }
}

